import './App.css';
import React from 'react'
import { BrowserRouter, Switch, Route } from 'react-router-dom'
import Test from './test'
/////////////////////////////////////////////////////// File
import Dasboard from './Component/PageDashboard/Dasboard';

function App() {

  return (
    <BrowserRouter>
      <div className="App">
        <Switch>
          <Route path='/' component={Dasboard} />
        </Switch>
        <Switch>
          <Route path='/QR' component={Test} />
        </Switch>

      </div>
    </BrowserRouter>
  );
}

export default App;
